import MainFRAME from "../components/MainFRAME";
import SignupForm from "../components/SignupForm";

const Homepage = () => {
  return (
    <div className="w-full relative bg-gradient-to-r from-blue-900 to-black overflow-hidden flex flex-row items-center justify-start pt-24 pb-24 pr-20 pl-20 box-border gap-0 lg:flex-wrap lg:gap-0 lg:p-10 mq750:gap-0 mq750:p-5">
      <div className="flex-1 flex flex-col items-start justify-start py-0 pr-1 pl-0 box-border min-w-full lg:min-h-auto mq750:min-w-full">
        <MainFRAME />
      </div>
      <SignupForm />
    </div>

  );
};

export default Homepage;
